import React from 'react';
import ReactDOM from 'react-dom';
import faker from 'faker';
import CommentDetail from './CommentDetail';


const App = () => {
    return (
        <div className="ui container comments">
            <CommentDetail author = "Ross" timeago="Today at 4:45PM" />
            <CommentDetail  author = "Rachel" timeago="Today at 3:45PM"/>
            <CommentDetail author = "Joey" timeago="Today at 2:45PM"/>
            <CommentDetail author="Chandler" timeago="Today at 12:45PM"/>
        </div>

    );
};

ReactDOM.render(< App />,document.querySelector('#root'));
